elpDesk',39249920,'MDQ6VXNlcjM5MjQ5OTIw','https://avatars3.githubusercontent.com/u/39249920?v=4','','https://api.github.com/users/NVDAHelpDesk','https://github.com/NVDAHelpDesk','https://api.github.com/users/NVDAHelpDesk/followers','https://api.github.com/users/NVDAHelpDesk/following{/other_user}','https://api.github.com/users/NVDAHelpDesk/gists{/gist_id}','https://api.github.com/users/NVDAHelpDesk/starred{/owner}{/repo}','https://api.github.com/users/NVDAHelpDesk/subscriptions','https://api.github.com/users/NVDAHelpDesk/orgs','https://api.github.com/users/NVDAHelpDesk/repos','https://api.github.com/users/NVDAHelpDesk/events{/privacy}','https://api.github.com/users/NVDAHelpDesk/received_events','User','open',13,'2018-12-20T05:20:49Z','2019-01-01T15:00:00Z',NULL,'NONE','### 問題の再現手順
\n1. メモ帳を開く
\n2. 日本語変換オンでabcdefgと入力する
\n3. F9\,F10\,Ctrl+Tのいずれかで、アルファベットに変換する
\n4. abcdefgと関係なさそうなアルファベットが読み上げられる
\n
\n### 期待されること
\nabcdefgがエービーシーディーイーエフジーと読み上げられる
\n
\n### 実際に起きること
\nabcdefgと関係なさそうなアルファベットが読み上げられる。
\n
\n### システム構成
\nNVDA 日本語版 2018.4jp インストール環境
\nWindows 10 バージョン 1803 日本語環境
\n
