\n```
\nconfigure: QuickTime 64-bit development files not found\, video decoding won''t be supported.
\nconfigure: X 64-bit development files not found\, the X11 driver won''t be supported.
\nconfigure: libsane 64-bit development files not found\, scanners won''t be supported.
\nconfigure: libv4l 64-bit development files not found.
\nconfigure: libgphoto2 64-bit development files not found\, digital cameras won''t be supported.
\nconfigure: libgphoto2_port 64-bit development files not found\, digital cameras won''t be auto-detected.
\nconfigure: libpulse 64-bit development files not found or too old\, Pulse won''t be supported.
\nconfigure: OSS sound system found but too old (OSSv4 needed)\, OSS won''t be supported.
\nconfigure: libudev 64-bit development files not found\, plug and play won''t be supported.
\nconfigure: libSDL2 64-bit development files not found\, SDL2 won''t be supported.
\nconfigure: libcapi20 64-bit development files not found\, ISDN won''t be supported.
\nconfigure: libgsm 64-bit development files not found\, gsm 06.10 codec won''t be supported.
\nconfigure: libkrb5 64-bit development files not found (or too old)\, Kerberos won''t be supported.
\nconfigure: libgssapi_krb5 64-bit development files not found (or too old)\, no Kerberos SSP support.
\nconfigure: openal-soft 64-bit development files not found (or too old)\, XAudio2 won''t be supported.
\n```
\nSome of them have a macport\, but the builder fails with error 404 when trying to install them\, which is strange since they exist.','2019-01-01T15:00:04Z',29503472,'PhoenicisOrg','https://api.github.com/repos/PhoenicisOrg/phoenicis-winebuild/issues/comments/450736427','https://github.com/PhoenicisOrg/phoenicis-winebuild/issues/39#issuecomment-450736427','https://api.github.com/repos/PhoenicisOrg/phoenicis-winebuild/issues/39',450736427,'MDEyOklzc3VlQ29tbWVudDQ1MDczNjQyNw==','qparis',373645,'MDQ6VXNlcjM3MzY0NQ==','https://avatars2.githubusercontent.com/u/373645?v=4','','https://api.github.com/users/qparis','https://github.com/qparis','https://api.github.com/users/qparis/followers','https://api.github.com/users/qparis/following{/other_user}','https://api.github.com/users/qparis/gists{/gist_id}','https://api.github.com/users/qparis/starred{/owner}{/repo}','https://api.github.com/users/qparis/subscriptions','https://api.github.com/users/qparis/orgs','https://api.github.com/users/qparis/repos','https://api.github.com/users/qparis/events{/privacy}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
