\n**What**
\nJSDoc typedefs should be stored in customTypes.
\nNeed to support all forms of @typedef description
\n
\n*short description*
\n```js
\n/**
\n * A number\, or a string containing a number.
\n * @typedef {(number|string)} NumberLike
\n */
\n```
\n
\n*short description of object*
\n```js
\n/**
\n * Point in x\, y space
\n * @typedef {{x: number\, y: number}} Point
\n */
\n```
\n
\n*long description*
\n```js
\n/**
\n * Point in x\, y space
\n * @typedef {Object} Point
\n * @property {number} x - x coordinate
\n * @property {number} y - y coordinate
\n */
\n```
\n
\nCustomTypes property format
\n```js
\n{
\n  customTypes: {
\n    typeName: {
\n      description: ''string''\,
\n      type: ???
\n    }
\n  }
\n}
\n```
\n
\n**Why**
\nIn props and events we show types from JSDoc. We should provide information about this types if consumer would use it.
\n
\n**Definition Of Done**
\n[ ] short description is parsed
\n[ ] short object description is parsed
\n[ ] long description is parsed
\n[ ] there is no doctrine AST in output
\n[ ] format is like proposed above
\n','2019-01-01T15:00:05Z',NULL,NULL,'https://api.github.com/repos/Crazymax11/vue-metainfo-loader/issues/comments/450736428','https://github.com/Crazymax11/vue-metainfo-loader/issues/7#issuecomment-450736428','https://api.github.com/repos/Crazymax11/vue-metainfo-loader/issues/7',450736428,'MDEyOklzc3VlQ29tbWVudDQ1MDczNjQyOA==','Crazymax11',1172396,'MDQ6VXNlcjExNzIzOTY=','https://avatars0.githubusercontent.com/u/1172396?v=4','','https://api.github.com/users/Crazymax11','https://github.com/Crazymax11','https://api.github.com/users/Crazymax11/followers','https://api.github.com/users/Crazymax11/following{/other_user}','https://api.github.com/users/Crazymax11/gists{/gist_id}','https://api.github.com/users/Crazymax11/starred{/owner}{/repo}','https://api.github.com/users/Crazymax11/subscriptions','https://api.github.com/users/Crazymax11/orgs','https://api.github.com/users/Crazymax11/repos','https://api.github.com/users/Crazymax11/events{/privacy}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
