 suffix to resource names?','rclark',515424,'MDQ6VXNlcjUxNTQyNA==','https://avatars0.githubusercontent.com/u/515424?v=4','','https://api.github.com/users/rclark','https://github.com/rclark','https://api.github.com/users/rclark/followers','https://api.github.com/users/rclark/following{/other_user}','https://api.github.com/users/rclark/gists{/gist_id}','https://api.github.com/users/rclark/starred{/owner}{/repo}','https://api.github.com/users/rclark/subscriptions','https://api.github.com/users/rclark/orgs','https://api.github.com/users/rclark/repos','https://api.github.com/users/rclark/events{/privacy}','https://api.github.com/users/rclark/received_events','User','closed',7,'2018-06-30T01:10:57Z','2019-01-01T15:00:06Z','2018-07-04T08:43:03Z','COLLABORATOR','Using a L2 construct (I think that''s how you refer to them) to define a resource doesn''t allow me to explicitly define the resource''s logical name. 
\n
\n```js
\nnew Role(stack\, \"FunctionRole\"\, {
\n  assumedBy: new ServicePrincipal(''lambda.amazonaws.com'')
\n});
\n```
\n
\n==> 
\n
\n```yml
\n      FunctionRole111A5701:
\n        Type: ''AWS::IAM::Role''
\n        Properties:
\n            AssumeRolePolicyDocument:
\n                Statement:
\n                    -
\n                        Action: ''sts:AssumeRole''
\n                        Effect: Allow
\n                        Principal:
\n                            Service: lambda.amazonaws.com
\n                Version: ''2012-10-17''
\n```
\n
\nReasons that I''d like to be able to set the logical name precisely:
\n
\n- if I need to look at my template to debug anything\, or if I have workflows that involve inspecting templates in API responses or the console UI\, it can be easier to deal with if I can explicitly set my resource''s logical name
\n
\n- if I have to resort to L1 constructs from ''@aws-cdk/resources''\, the pattern is changed -- while the `name` argument looks the same\, I end up without a suffixed logical resource name
\n
\n```js
\nnew logs.LogGroupResource(stack\, ''Logs''\, {
\n  logGroupName: new FnSub(''/aws/lambda/${AWS::StackName}'') as any\,
\n  retentionInDays: 14
\n});
\n```
\n
\n==> 
\n
\n```yml
\n    Logs:
\n        Type: ''AWS::Logs::LogGroup''
\n        Properties:
\n            LogGroupName:
\n                ''Fn::Sub'': ''/aws/lambda/${AWS::StackName}''
\n            RetentionInDays: 14
\n```','2019-01-01T15:00:06Z',3299148,'awslabs','https://api.github.com/repos/awslabs/aws-cdk/issues/comments/450736430','https://github.com/awslabs/aws-cdk/issues/207#issuecomment-450736430','https://api.github.com/repos/awslabs/aws-cdk/issues/207',450736430,'MDEyOklzc3VlQ29tbWVudDQ1MDczNjQzMA==','eladb',598796,'MDQ6VXNlcjU5ODc5Ng==','https://avatars3.githubusercontent.com/u/598796?v=4','','https://api.github.com/users/eladb','https://github.com/eladb','https://api.github.com/users/eladb/followers','https://api.github.com/users/eladb/following{/other_user}','https://api.github.com/users/eladb/gists{/gist_id}','https://api.github.com/users/eladb/starred{/owner}{/repo}','https://api.github.com/users/eladb/subscriptions','https://api.github.com/users/eladb/orgs','https://api.github.com/users/eladb/repos','https://api.github.com/users/eladb/events{/privacy}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
