95074066,'MDU6SXNzdWUzOTUwNzQwNjY=',106,'Custom methods inside Table class not functioning after redraw','arbitrager44',46244905,'MDQ6VXNlcjQ2MjQ0OTA1','https://avatars0.githubusercontent.com/u/46244905?v=4','','https://api.github.com/users/arbitrager44','https://github.com/arbitrager44','https://api.github.com/users/arbitrager44/followers','https://api.github.com/users/arbitrager44/following{/other_user}','https://api.github.com/users/arbitrager44/gists{/gist_id}','https://api.github.com/users/arbitrager44/starred{/owner}{/repo}','https://api.github.com/users/arbitrager44/subscriptions','https://api.github.com/users/arbitrager44/orgs','https://api.github.com/users/arbitrager44/repos','https://api.github.com/users/arbitrager44/events{/privacy}','https://api.github.com/users/arbitrager44/received_events','User','open',2,'2019-01-01T11:09:53Z','2019-01-01T15:00:07Z',NULL,'NONE','Hi. First\, this is an extremely useful package. Thanks @dmnfarrell  for your hard work.
\n
\nI''m trying to write a UI that includes a custom method for handleCellEntry. The code I''ve written works fine the first time you make an edit to the target cells. However I also have a dropdown menu that filters the dataframe. Once the user does that\, handleCellEntry no longer functions. 
\n
\nI believe I know why\, but I''m not sure how to fix it. In the code below\, I believe once the filtering happens\, the ''ui_df'' in the TableOvrRd class isn''t the same as the ''self.model.table.df'' used in the main class. I''m figuring there is a right way to get these classes to talk to each other\, but all the pythonic ways of operating between classes that I''m aware of don''t work. I''m just not sure if there is something special about how pandastable  is working that I''m not understanding.
\n
\nAnyway\, here''s a toy example of what I''m working on. The real app has much more widgets for altering the dataframe\, I just included one to make the example simple. 
\n
\nHopefully if I''m just doing something stupid that others will learn from my mistakes! Thanks in advance to the community for your help.
\n
\n```
\nimport pandas as pd
\nimport numpy as np
\nfrom tkinter import *
\nfrom tkinter import ttk
\nfrom pandastable import Table\, TableModel
\n
\nclass TableOvrRide(Table):
\n    def __init__(self\, parent=None\, **kwargs):
\n        Table.__init__(self\, parent\, **kwargs)
\n        return
\n    
\n    def handleCellEntry(self\, row\, col):
\n        #do in-cell calculation
\n        print(''cell'')
\n        super().handleCellEntry(row\, col)
\n        ui_df.iloc[row\, 4] = int(ui_df.iloc[row\, 2]) + int(ui_df.iloc[row\, 3])
\n        self.redraw()
\n        return
\n        
\nclass UserInterface(Frame):
\n    def __init__(self\, parent=None):
\n        #set up main UI
\n        global pt
\n        self.parent = parent
\n        Frame.__init__(self)
\n        self.main = self.master
\n        f = Frame(self.main)
\n        f.grid(column=0\, row=1\, sticky=(E\, W))
\n        screen_width = f.winfo_screenwidth() * 0.8
\n        screen_height = f.winfo_screenheight() * 0.7
\n        self.table = pt = TableOvrRide(f\, dataframe=ui_df\, height = screen_height\, width = screen_width)
\n        pt.show()
\n        return
\n        
\n    def change_df_combo(self\, event):
\n        #Responds to combobox\, filters by state''
\n        combo_selection = str(combo_box.get())
\n        self.table.model.df = pos_df.loc[pos_df[''State''] == combo_selection]
\n        pt.redraw()
\n        return
\n
\npos_data = {''Location'' : [''Denver''\, ''Boulder''\, ''San Diego''\, ''Reno''\, ''Portland''\,
\n    ''Eugene''\, ''San Francisco'']\, ''State'' : [''co''\, ''co''\, ''ca''\, ''nv''\,
\n    ''or''\, ''or''\, ''ca'']\, ''Rando_num'': [18\, 5\, 34\, 11\, 72\, 42\, 9]\,
\n    ''Other_num'': [11\, 26\, 55\, 134\, 88\, 4\, 22]}
\npos_df = pd.DataFrame(data = pos_data)
\npos_df[''Sum''] = pos_df[''Rando_num''] + pos_df[''Other_num'']
\n
\nui_df = pos_df
\n
\n#Launch Tkinter basics
\nroot = Tk()
\nroot.title(\"S test...\")
\n
\nmainframe = ttk.Frame(root\, padding=\"3 3 12 12\")
\nmainframe.grid(column=0\, row=1\, sticky=(N\, W\, E\, S))
\nmainframe.columnconfigure(0\, weight=1)
\nmainframe.rowconfigure(0\, weight=1)
\nscreen_width = mainframe.winfo_screenwidth() * 0.8
\nscreen_height = mainframe.winfo_screenheight() * 0.7
\n
\nui = UserInterface(mainframe)
\n
\n#Combobox to filter df
\ncombo_choices = [''ca''\, ''co''\, ''nv''\, ''or'']
\nchoice = StringVar()
\ncombo_box = ttk.Combobox(root\, textvariable=choice)
\ncombo_box[''values''] = combo_choices
\ncombo_box.grid(column=0\, row=0\, sticky=(W))
\ncombo_box.bind(''<<ComboboxSelected>>''\, ui.change_df_combo)
\n
\nroot.mainloop()
\n```
