ust because one is building it and the other is\nchecking it. Much more sensible to have a single function that builds\nit\, and then rsa2_verify can compare the received integer against that\nwhile rsa2_sign encodes it into an output integer.','https://api.github.com/repos/ranvis/putty/commits/5b0f32a10008f0f487eca670373cc6a7e58a6b89',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
