ook at the actual code in the file. Now primes[] is\ninitialised as necessary when genprime is first called.\n\n(Since we only use primes up to 2^16\, I didn''t see any point in doing\nanything fancy; this is the most trivial Sieve of Eratosthenes.)','https://api.github.com/repos/ranvis/putty/commits/d73a1716f603348739b55b953c3aaa0b86f0ffab',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
