rary module mpint.c\, with API differences both large and small.\n\nThe main aim of this change is that the new library should be free of\ntiming- and cache-related side channels. I''ve written the code so that\nit _should_ - assuming I haven''t made any mistakes - do all of its\nwork without either control flow or memory addressing depending on the\ndata words of the input numbers. (Though\, being an _arbitrary_\nprecision library\, it does have to at least depend on the sizes of the\nnumbers - but there''s a ''formal'' size that can vary separately from\nthe actual magnitude of the represented integer\, so if you want to\nkeep it secret that your number is actually small\, it should work fine\nto have a very long mp_int and just happen to store 23 in it.) So I''ve\ndone all my conditionalisation by means of computing both answers and\ndoing bit-masking to swap the right one into place\, and all loops over\nthe words of an mp_int go up to the formal size rather than the actual\nsize.\n\nI haven''t actually tested the constant-time property in any rigorous\nway yet (I''m still considering the best way to do it). But this code\nis surely at the very least a big improvement on the old version\, even\nif I later find a few more things to fix.\n\nI''ve also completely rewritten the low-level elliptic curve arithmetic\nfrom sshecc.c; the new ecc.c is closer to being an adjunct of mpint.c\nthan it is to the SSH end of the code. The new elliptic curve code\nkeeps all coordinates in Montgomery-multiplication transformed form to\nspeed up all the multiplications mod the same prime\, and only converts\nthem back when you ask for the affine coordinates. Also\, I adopted\nextended coordinates for the Edwards curve implementation.\n\nsshecc.c has also had a near-total rewrite in the course of switching\nit over to the new system. While I was there\, I''ve separated ECDSA and\nEdDSA more completely - they now have separate vtables\, instead of a\nsingle vtable in which nearly every function had a big if statement in\nit - and also made the externally exposed types for an ECDSA key and\nan ECDH context different.\n\nA minor new feature: since the new arithmetic code includes a modular\nsquare root function\, we can now support the compressed point\nrepresentation for the NIST curves. We seem to have been getting along\nfine without that so far\, but it seemed a shame not to put it in\,\nsince it was suddenly easy.\n\nIn sshrsa.c\, one major change is that I''ve removed the RSA blinding\nstep in rsa_privkey_op\, in which we randomise the ciphertext before\ndoing the decryption. The purpose of that was to avoid timing leaks\ngiving away the plaintext - but the new arithmetic code should take\nthat in its stride in the course of also being careful enough to avoid\nleaking the _private key_\, which RSA blinding had no way to do\nanything about in any case.\n\nApart from those specific points\, most of the rest of the changes are\nmore or less mechanical\, just changing type names and translating code\ninto the new API.','https://api.github.com/repos/ranvis/putty/commits/25b034ee39f557cab6e6e7b79591ef46c72cba92',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
