(8820624718,'PullRequestEvent',104187,'AnthonySteele','AnthonySteele','','https://api.github.com/users/AnthonySteele','https://avatars.githubusercontent.com/u/104187?',18554152,'justeat/JustSaying','https://api.github.com/repos/justeat/JustSaying','opened',495,'https://api.github.com/repos/justeat/JustSaying/pulls/495',241637569,'MDExOlB1bGxSZXF1ZXN0MjQxNjM3NTY5','https://github.com/justeat/JustSaying/pull/495','https://github.com/justeat/JustSaying/pull/495.diff','https://github.com/justeat/JustSaying/pull/495.patch','https://api.github.com/repos/justeat/JustSaying/issues/495',495,'open','Use \"Logging.Abstractions\" version 2 for all target frameworks','AnthonySteele',104187,'MDQ6VXNlcjEwNDE4Nw==','https://avatars2.githubusercontent.com/u/104187?v=4','','https://api.github.com/users/AnthonySteele','https://github.com/AnthonySteele','https://api.github.com/users/AnthonySteele/followers','https://api.github.com/users/AnthonySteele/following{/other_user}','https://api.github.com/users/AnthonySteele/gists{/gist_id}','https://api.github.com/users/AnthonySteele/starred{/owner}{/repo}','https://api.github.com/users/AnthonySteele/subscriptions','https://api.github.com/users/AnthonySteele/orgs','https://api.github.com/users/AnthonySteele/repos','https://api.github.com/users/AnthonySteele/events{/privacy}','https://api.github.com/users/AnthonySteele/received_events','User','_Summarise the changes this Pull Request makes._
\n
\nUse `Microsoft.Extensions.Logging.Abstractions` version 2.0 for all target frameworks.
\n
\nAlthough it may be more technically correct to use version 1.1 for the `net461` target
\nWhat we found when using this\, was that other libs  (e.g. [NLog.Extensions.Logging](https://www.nuget.org/packages/NLog.Extensions.Logging/) or [Serilog.Extensions.Logging](https://www.nuget.org/packages/Serilog.Extensions.Logging/)) force the use of Logging.Abstractions version 2.0 anyway on `net461`. And reconciling this is additional hassle. It is simpler to always use  Logging.Abstractions version 2.0.
\n
\n_Please include a reference to a GitHub issue if appropriate._
\n
\nThis [was mentioned in comments](https://github.com/justeat/JustSaying/pull/493#issuecomment-449739928) for #493 but decided for a separate PR.
