erval\nand timeout are too short.\n\nThe short ping interval leads to ping sending a follow-up ping before\nthe reply arrives\, thus sending more than the requested 10 ICMP\nrequests. Those are mirrored\, and over a certain threshold the test case\nrun is considered a failure\, because too much traffic is observed.\n\nThe short timeout leads to ping not having enough time to push out all\nthe ICMP requests (because the system is overwhelmed by the extra\nmirrored traffic)\, which then leads to missing traffic and a spuriously\nfailing test.\n\nBump both numbers 5x to accommodate for the extra traffic inherent in\nmirroring tests.\n\nSigned-off-by: Petr Machata <petrm@mellanox.com>\nSigned-off-by: Ido Schimmel <idosch@mellanox.com>','https://api.github.com/repos/jpirko/linux_mlxsw/commits/f34b7da9fb8183ad2c3d40c176e8052a98fccbb2',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
