he\ncondition too soon leads to spurious \"seen 9\, expected 10\" failures as\nthe last packet doesn''t have enough time to get mirrored and the mirror\nto arrive and bump the observed counters.\n\nWait for one ping interval before evaluating the test.\n\nSigned-off-by: Petr Machata <petrm@mellanox.com>\nSigned-off-by: Ido Schimmel <idosch@mellanox.com>','https://api.github.com/repos/jpirko/linux_mlxsw/commits/43d14f8eb70b9e8f61e025e2eb492b80d0eeeb87',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
