e tests\, but then\ncalls log_tests for every individual test. Thus a failure in one of the\ntests causes spurious failures in follow-up tests as well.\n\nFix by moving the initialization of RET from test_all() to\nfull_test_span_gre_dir_acl()\, a function that implements the test.\n\nSigned-off-by: Petr Machata <petrm@mellanox.com>\nSigned-off-by: Ido Schimmel <idosch@mellanox.com>','https://api.github.com/repos/jpirko/linux_mlxsw/commits/3967a54b6e93d3f3fc0aa29e1186be0b6a4e4149',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
