 does\nprompt update of FDB entries by arpinging. But because the neighbor\nstill references another address\, offloading is not possible\, and some\npackets may end up not being mirrored.\n\nTo force the neighbor renegotiation\, simply flush the neighbor table at\nthe bridge.\n\nSigned-off-by: Petr Machata <petrm@mellanox.com>','https://api.github.com/repos/jpirko/linux_mlxsw/commits/1973a7f4aee4af667a35718120c45fd3eda42e49',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
