es/123',392059432,'MDU6SXNzdWUzOTIwNTk0MzI=',123,'Column layout specified in .xml files overriding base themes.','chrBrd',16094329,'MDQ6VXNlcjE2MDk0MzI5','https://avatars2.githubusercontent.com/u/16094329?v=4','','https://api.github.com/users/chrBrd','https://github.com/chrBrd','https://api.github.com/users/chrBrd/followers','https://api.github.com/users/chrBrd/following{/other_user}','https://api.github.com/users/chrBrd/gists{/gist_id}','https://api.github.com/users/chrBrd/starred{/owner}{/repo}','https://api.github.com/users/chrBrd/subscriptions','https://api.github.com/users/chrBrd/orgs','https://api.github.com/users/chrBrd/repos','https://api.github.com/users/chrBrd/events{/privacy}','https://api.github.com/users/chrBrd/received_events','User','open',0,'2018-12-18T09:11:04Z','2019-01-01T15:00:15Z',NULL,'NONE','Upgrading this module from 2.4 to 2.4.3 broke our site''s layout. Our theme is built off the Magento base theme (which uses `2columns-left` for category layout) and we hadn''t explicitly specified a `layout` attribute in the theme''s `page` element. The new `catalog_product_view.xml` etc.layouts included with this module _do_ have a `layout` attribute specified\, and it overrode our theme.
\n
\nWhile it''s served as a good indicator that we should explicitly declare page layouts in our theme to prevent this happening in future\, the layout files in this module should not declare anything beyond the bare minimum required for them to work; all those `layout=\"1column\"` entries should possibly be removed.
