78,'MDU6SXNzdWUzNzk1NzE2Nzg=',246,'BUNDLER_VERSION env variable will afffect how bundler works in the future','deivid-rodriguez',2887858,'MDQ6VXNlcjI4ODc4NTg=','https://avatars2.githubusercontent.com/u/2887858?v=4','','https://api.github.com/users/deivid-rodriguez','https://github.com/deivid-rodriguez','https://api.github.com/users/deivid-rodriguez/followers','https://api.github.com/users/deivid-rodriguez/following{/other_user}','https://api.github.com/users/deivid-rodriguez/gists{/gist_id}','https://api.github.com/users/deivid-rodriguez/starred{/owner}{/repo}','https://api.github.com/users/deivid-rodriguez/subscriptions','https://api.github.com/users/deivid-rodriguez/orgs','https://api.github.com/users/deivid-rodriguez/repos','https://api.github.com/users/deivid-rodriguez/events{/privacy}','https://api.github.com/users/deivid-rodriguez/received_events','User','open',3,'2018-11-11T22:41:22Z','2019-01-01T15:00:16Z',NULL,'NONE','The official docker images set several environment variables that as far as I know only affect building the image. It has been proposed in the past to move these environment variables to `ARG`s\, but it was [rejected](https://github.com/docker-library/ruby/pull/112#issuecomment-421143450).
\n
\nThe future behavior of bundler will be that it will automatically exec to the bundler version the lock file was generated with (the `BUNDLED_WITH` section in the lock file). This default behavior will be overridable with an environment variable called `BUNDLER_VERSION`.
\n
\nThe problem is that since the ruby docker images set the `BUNDLER_VERSION`\, that will change the default behavior of `bundler` to ignore the version locked in the lock file. As bundler maintainers\, we think this will cause confusion and will inhibit this new feature that we consider interesting to end users.
\n
\nSo\, I would like to request that this environment variable is moved to an `ARG`\, or at least renamed.
\n
\nSee https://github.com/bundler/bundler/issues/6782 for more.
\n
\nThanks!','2019-01-01T15:00:16Z',7739233,'docker-library','https://api.github.com/repos/docker-library/ruby/issues/comments/450736447','https://github.com/docker-library/ruby/issues/246#issuecomment-450736447','https://api.github.com/repos/docker-library/ruby/issues/246',450736447,'MDEyOklzc3VlQ29tbWVudDQ1MDczNjQ0Nw==','deivid-rodriguez',2887858,'MDQ6VXNlcjI4ODc4NTg=','https://avatars2.githubusercontent.com/u/2887858?v=4','','https://api.github.com/users/deivid-rodriguez','https://github.com/deivid-rodriguez','https://api.github.com/users/deivid-rodriguez/followers','https://api.github.com/users/deivid-rodriguez/following{/other_user}','https://api.github.com/users/deivid-rodriguez/gists{/gist_id}','https://api.github.com/users/deivid-rodriguez/starred{/owner}{/repo}','https://api.github.com/users/deivid-rodriguez/subscriptions','https://api.github.com/users/deivid-rodriguez/orgs','https://api.github.com/users/deivid-rodriguez/repos','https://api.github.com/users/deivid-rodriguez/events{/privacy}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
