599,'MDU6SXNzdWUzOTQ4MzI1OTk=',258,'Inactivity Time needed for a town to disband','Caeso2',45888840,'MDQ6VXNlcjQ1ODg4ODQw','https://avatars1.githubusercontent.com/u/45888840?v=4','','https://api.github.com/users/Caeso2','https://github.com/Caeso2','https://api.github.com/users/Caeso2/followers','https://api.github.com/users/Caeso2/following{/other_user}','https://api.github.com/users/Caeso2/gists{/gist_id}','https://api.github.com/users/Caeso2/starred{/owner}{/repo}','https://api.github.com/users/Caeso2/subscriptions','https://api.github.com/users/Caeso2/orgs','https://api.github.com/users/Caeso2/repos','https://api.github.com/users/Caeso2/events{/privacy}','https://api.github.com/users/Caeso2/received_events','User','open',13,'2018-12-29T23:24:25Z','2019-01-01T15:00:25Z',NULL,'NONE','There are high priority areas that many players want but are taken\, such as major cities or areas in their nation boundaries. The problem is many of these areas are claimed by inactive players. Due to this the pace of the server is slowing down to a halt because all wanted areas are claimed and it takes 40 days for someone to get kicked from a town. I propose to reduce the time down to 20 days and special exceptions could be made like if someone from a single person town is going on a trip but will be active again. Also this will result in more accurate nation population totals.
