n* Roman Yurchak +\n* Roy Zywina +\n\nA total of 137 people contributed to this release.\nPeople with a &quot;+&quot; by their names contributed a patch for the first time.\nThis list of names is automatically generated\, and may not be fully complete.\n   ```\n   \n  \n  \n  \n  \n  \n</details>\n\n\n \n\n<details>\n  <summary>Links</summary>\n  \n  - PyPI: https://pypi.org/project/scipy\n  - Changelog: https://pyup.io/changelogs/scipy/\n  - Repo: https://github.com/scipy/scipy/releases\n  - Homepage: https://www.scipy.org\n</details>\n\n\n\n\n\n### Update [setuptools](https://pypi.org/project/setuptools) from **40.4.3** to **40.6.3**.\n\n\n<details>\n  <summary>Changelog</summary>\n  \n  \n   ### 40.6.3\n   ```\n   -------\n\n* 1594: PEP 517 backend no longer declares setuptools as a dependency as it can be assumed.\n   ```\n   \n  \n  \n   ### 40.6.2\n   ```\n   -------\n\n* 1592: Fix invalid dependency on external six module (instead of vendored version).\n   ```\n   \n  \n  \n   ### 40.6.1\n   ```\n   -------\n\n* 1590: Fixed regression where packages without ``author`` or ``author_email`` fields generated malformed package metadata.\n   ```\n   \n  \n  \n   ### 40.6.0\n   ```\n   -------\n\n* 1541: Officially deprecated the ``requires`` parameter in ``setup()``.\n* 1519: In ``pkg_resources.normalize_path``\, additional path normalization is now performed to ensure path values to a directory is always the same\, preventing false positives when checking scripts have a consistent prefix to set up on Windows.\n* 1545: Changed the warning class of all deprecation warnings; deprecation warning classes are no longer derived from ``DeprecationWarning`` and are thus visible by default.\n* 1554: ``build_meta.build_sdist`` now includes ``setup.py`` in source distributions by default.\n* 1576: Started monkey-patching ``get_metadata_version`` and ``read_pkg_file`` onto ``distutils.DistributionMetadata`` to retain the correct version on the ``PKG-INFO`` file in the (deprecated) ``upload`` command.\n* 1533: Restricted the ``recursive-include setuptools/_vendor`` to contain only .py and .txt files.\n* 1395: Changed Pyrex references to Cython in the documentation.\n* 1456: Documented that the ``rpmbuild`` packages is required for the ``bdist_rpm`` command.\n* 1537: Documented how to use ``setup.cfg`` for ``src/ layouts``\n* 1539: Added minimum version column in ``setup.cfg`` metadata table.\n* 1552: Fixed a minor typo in the python 2/3 compatibility documentation.\n* 1553: Updated installation instructions to point to ``pip install`` instead of ``ez_setup.py``.\n* 1560: Updated ``setuptools`` distribution documentation to remove some outdated information.\n* 1564: Documented ``setup.cfg`` minimum version for version and project_urls.\n* 1572: Added the ``concurrent.futures`` backport ``futures`` to the Python 2.7 test suite requirements.\n   ```\n   \n  \n  \n   ### 40.5.0\n   ```\n   -------\n\n* 1335: In ``pkg_resources.normalize_path``\, fix issue on Cygwin when cwd contains symlinks.\n* 1502: Deprecated support for downloads from Subversion in package_index/easy_install.\n* 1517: Dropped use of six.u in favor of `u&quot;&quot;` literals.\n* 1520: Added support for ``data_files`` in ``setup.cfg``.\n* 1525: Fixed rendering of the deprecation warning in easy_install doc.\n   ```\n   \n  \n</details>\n\n\n \n\n<details>\n  <summary>Links</summary>\n  \n  - PyPI: https://pypi.org/project/setuptools\n  - Changelog: https://pyup.io/changelogs/setuptools/\n  - Repo: https://github.com/pypa/setuptools\n</details>\n\n\n\n\n\n### Update [six](https://pypi.org/project/six) from **1.11.0** to **1.12.0**.\n\n\n<details>\n  <summary>Changelog</summary>\n  \n  \n   ### 1.12.0\n   ```\n   ------\n\n- Issue 259\, pull request 260: `six.add_metaclass` now preserves\n  `__qualname__` from the original class.\n\n- Pull request 204: Add `six.ensure_binary`\, `six.ensure_text`\, and\n  `six.ensure_str`.\n   ```\n   \n  \n</details>\n\n\n \n\n<details>\n  <summary>Links</summary>\n  \n  - PyPI: https://pypi.org/project/six\n  - Changelog: https://pyup.io/changelogs/six/\n  - Repo: https://github.com/benjaminp/six\n  - Docs: https://pythonhosted.org/six/\n</details>\n\n\n\n\n\n### Update [Sphinx](https://pypi.org/project/Sphinx) from **1.8.1** to **1.8.3**.\n\n\n<details>\n  <summary>Changelog</summary>\n  \n  \n   ### 1.8.3\n   ```\n   ==============================\n\nDependencies\n------------\n\nIncompatible changes\n--------------------\n\nDeprecated\n----------\n\nFeatures added\n--------------\n\n* LaTeX: it is possible to insert custom material to appear on back of title\n  page\, see discussion of ``&#39;maketitle&#39;`` key of :confval:`latex_elements`\n  (``&#39;manual&#39;`` docclass only)\n\nBugs fixed\n----------\n\n* 5725: mathjax: Use CDN URL for &quot;latest&quot; version by default\n* 5460: html search does not work with some 3rd party themes\n* 5520: LaTeX\, caption package incompatibility since Sphinx 1.6\n* 5614: autodoc: incremental build is broken when builtin modules are imported\n* 5627: qthelp: index.html missing in QtHelp\n* 5659: linkcheck: crashes for a hyperlink containing multibyte character\n* 5754: DOC: Fix some mistakes in :doc:`/latex`\n* 5810: LaTeX: sphinxVerbatim requires explicit &quot;hllines&quot; set-up since 1.6.6\n  (refs: 1238)\n* 5636: C++\, fix parsing of floating point literals.\n* 5496 (again): C++\, fix assertion in partial builds with duplicates.\n* 5724: quickstart: sphinx-quickstart fails when $LC_ALL is empty\n* 1956: Default conf.py is not PEP8-compliant\n* 5849: LaTeX: document class ``\maketitle`` is overwritten with no\n  possibility to use original meaning in place of Sphinx custom one\n* 5834: apidoc: wrong help for ``--tocfile``\n* 5800: todo: crashed if todo is defined in TextElement\n* 5846: htmlhelp: convert hex escaping to decimal escaping in .hhc/.hhk files\n\nTesting\n--------\n   ```\n   \n  \n  \n   ### 1.8.2\n   ```\n   =====================================\n\nIncompatible changes\n--------------------\n\n* 5497: Do not include MathJax.js and jsmath.js unless it is really needed\n\nFeatures added\n--------------\n\n* 5471: Show appropriate deprecation warnings\n\nBugs fixed\n----------\n\n* 5490: latex: enumerated list causes a crash with recommonmark\n* 5492: sphinx-build fails to build docs w/ Python &lt; 3.5.2\n* 3704: latex: wrong ``\label`` positioning for figures with a legend\n* 5496: C++\, fix assertion when a symbol is declared more than twice.\n* 5493: gettext: crashed with broken template\n* 5495: csv-table directive with file option in included file is broken (refs:\n  4821)\n* 5498: autodoc: unable to find type hints for a ``functools.partial``\n* 5480: autodoc: unable to find type hints for unresolvable Forward references\n* 5419: incompatible math_block node has been generated\n* 5548: Fix ensuredir() in case of pre-existing file\n* 5549: graphviz Correctly deal with non-existing static dir\n* 3002: i18n: multiple footnote_references referring same footnote causes\n  duplicated node_ids\n* 5563: latex: footnote_references generated by extension causes LaTeX builder\n  crashed\n* 5561: make all-pdf fails with old xindy version\n* 5557: quickstart: --no-batchfile isn&#39;t honored\n* 3080: texinfo: multiline rubrics are broken\n* 3080: texinfo: multiline citations are broken\n   ```\n   \n  \n</details>\n\n\n \n\n<details>\n  <summary>Links</summary>\n  \n  - PyPI: https://pypi.org/project/sphinx\n  - Changelog: https://pyup.io/changelogs/sphinx/\n  - Homepage: http://sphinx-doc.org/\n</details>\n\n\n\n\n\n### Update [tox](https://pypi.org/project/tox) from **3.0.0** to **3.6.1**.\n\n\n*The bot wasn''t able to find a changelog for this release. [Got an idea?](https://github.com/pyupio/changelogs/issues/new)*\n\n<details>\n  <summary>Links</summary>\n  \n  - PyPI: https://pypi.org/project/tox\n  - Docs: https://tox.readthedocs.org/\n</details>\n\n\n\n\n\n### Update [urllib3](https://pypi.org/project/urllib3) from **1.23** to **1.24.1**.\n\n\n<details>\n  <summary>Changelog</summary>\n  \n  \n   ### 1.24\n   ```\n   -----------------\n\n* Allow key_server_hostname to be specified when initializing a PoolManager to allow custom SNI to be overridden. (Pull 1449)\n\n* Test against Python 3.7 on AppVeyor. (Pull 1453)\n\n* Early-out ipv6 checks when running on App Engine. (Pull 1450)\n\n* Change ambiguous description of backoff_factor (Pull 1436)\n\n* Add ability to handle multiple Content-Encodings (Issue 1441 and Pull 1442)\n\n* Skip DNS names that can&#39;t be idna-decoded when using pyOpenSSL (Issue 1405).\n\n* Add a server_hostname parameter to HTTPSConnection which allows for\n  overriding the SNI hostname sent in the handshake. (Pull 1397)\n\n* Drop support for EOL Python 2.6 (Pull 1429 and Pull 1430)\n\n* Fixed bug where responses with header Content-Type: message/* erroneously\n  raised HeaderParsingError\, resulting in a warning being logged. (Pull 1439)\n\n* Move urllib3 to src/urllib3 (Pull 1409)\n   ```\n   \n  \n</details>\n\n\n \n\n<details>\n  <summary>Links</summary>\n  \n  - PyPI: https://pypi.org/project/urllib3\n  - Changelog: https://pyup.io/changelogs/urllib3/\n  - Docs: https://urllib3.readthedocs.io/\n</details>\n\n\n\n\n\n### Update [virtualenv](https://pypi.org/project/virtualenv) from **16.1.0** to **16.2.0**.\n\n\n*The bot wasn''t able to find a changelog for this release. [Got an idea?](https://github.com/pyupio/changelogs/issues/new)*\n\n<details>\n  <summary>Links</summary>\n  \n  - PyPI: https://pypi.org/project/virtualenv\n  - Changelog: https://pyup.io/changelogs/virtualenv/\n  - Homepage: https://virtualenv.pypa.io/\n</details>\n\n\n\n\n\n','2019-01-01T15:00:30Z','2019-01-01T15:00:30Z',NULL,NULL,NULL,'https://api.github.com/repos/AhmadZakaria/ScotlandPYard/pulls/365/commits','https://api.github.com/repos/AhmadZakaria/ScotlandPYard/pulls/365/comments','https://api.github.com/repos/AhmadZakaria/ScotlandPYard/pulls/comments{/number}',